import { Box } from '@mui/material';
import React from 'react';
import { SelectLabelsDouble } from './components/selectBoxDoubleRoom';
// import { WovenImageListDouble } from './components/ImageListDoubleRoom';
import { Link } from 'react-router-dom';
import { Button } from '@mui/material';
export default function BookNow() {
  const [roomType, setRoomType] = useState('');
  const [guests, setGuests] = useState('');
  const [checkInDate, setCheckInDate] = useState('');
  const [checkOutDate, setCheckOutDate] = useState('');
  const [error, setError] = useState(false);

  const handleRoomChange = (event) => {
    setRoomType(event.target.value);
    setGuests('');
    setError(false);
  };

  const handleGuestsChange = (event) => {
    setGuests(event.target.value);
  };

  const handleCheckInDateChange = (event) => {
    setCheckInDate(event.target.value);
  };

  const handleCheckOutDateChange = (event) => {
    setCheckOutDate(event.target.value);
  };

  const handleSubmit = async () => {
    if (!roomType || !guests || !checkInDate || !checkOutDate) {
      setError(true);
    } else {
      setError(false);
      const response = await fetch("http://localhost:5000/api/booking/details", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ roomType, guests, checkInDate, checkOutDate, userId: "someUserId" }), // Replace with actual userId
      });

      const data = await response.json();
      if (response.ok) {
        console.log(`Booking details: Room Type: ${roomType}, Number of Guests: ${guests}`);
      } else {
        alert(data.message || 'Failed to submit the booking details');
      }
    }
  };

  return (
    <Container sx={{ py: 5 }}>
      <Box sx={{ display: 'flex', justifyContent: 'center' }}>
        <FormControl fullWidth error={error} sx={{ maxWidth: 300 }}>
          <InputLabel>Room Type</InputLabel>
          <Select value={roomType} onChange={handleRoomChange} label="Room Type">
            <MenuItem value="kingDeluxe">King Deluxe</MenuItem>
            <MenuItem value="queenStandard">Queen Standard</MenuItem>
          </Select>
          {error && <FormHelperText>All fields are required</FormHelperText>}
        </FormControl>
      </Box>

      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
        <FormControl fullWidth sx={{ maxWidth: 300 }}>
          <InputLabel>Guests</InputLabel>
          <Select value={guests} onChange={handleGuestsChange} label="Guests">
            <MenuItem value={1}>1</MenuItem>
            <MenuItem value={2}>2</MenuItem>
            <MenuItem value={3}>3</MenuItem>
          </Select>
        </FormControl>
      </Box>

      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
        <input
          type="date"
          value={checkInDate}
          onChange={handleCheckInDateChange}
          style={{ width: '100%', maxWidth: '300px' }}
        />
      </Box>

      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
        <input
          type="date"
          value={checkOutDate}
          onChange={handleCheckOutDateChange}
          style={{ width: '100%', maxWidth: '300px' }}
        />
      </Box>

      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
        <Button variant="contained" onClick={handleSubmit}>Submit</Button>
      </Box>
    </Container>
  );
}
